import React from 'react'
import { Person } from 'react-bootstrap-icons'

function PersonalMessages(props) {
  return (
    <div className='personal-message'>
         
            {
                props.value.map( (oneMessage,i) => {
                  
                 return (
                 <div key={i} className='oneMessage  text-light d-flex gap-2 m-2 justify-content-end'>
                        <p  key={i} className='bg-primary d-inline p-2 px-4 rounded-pill '>{oneMessage}</p>
                        <div key={i} className='avatar-div'> <Person size={25}/></div>
                    </div> )
                })
            }
            
    </div>
  )
}

export default PersonalMessages
